import styled from 'styled-components';
import { createGlobalStyle } from 'styled-components';

const GlobalStyle = createGlobalStyle`
  body {
    margin: 0;
  }
`;

const StyledMain = styled.main`
  background: red;
`;

export { StyledMain, GlobalStyle };
